text:
{'text': 'Like any other masjid of Singapore, ar-raudhah is yet another architectural marvel, unique design of intricately woven cubes when one looks from within. This cube patterned cutwork in the ceiling is the signature of this masjid.

The masjid is spacious and airy and has a big hall to accommodate and entertain social gatherings like nikah ceremonies.

Ar-raudhah is located at a prime location of cross roads, so one can easily locate it. It is also close to Bukit Batok MRT station.', 'languageCode': 'en'}

